import Club from "./Club";

function ClubList(props) {
  return (
    <div>
      <ul>
        {props.dataClub.map((cardClub) => {
          return <Club cardClub={cardClub} />;
        })}
      </ul>
    </div>
  );
}

export default ClubList;
